/* eslint-disable array-callback-return */
import React, { Component } from 'react';
import {
    OwpButton,
    OwpSearchDateField,
    OwpSearchSelectField,
    OwpSearchTextField,
    OwpTextField,
    OwpTreeGrid,
} from 'owp/wrapper';
import Formsy from 'formsy-react';
import * as TGEvent from 'owp/TGEvent';
import moment from 'moment';
import { query } from 'owp/api';
import { setGridData, setRowAttribute } from 'main/GridUtill';
import { getBoolValue } from 'main/CommonUtils';

const FPNUNIT = 'FPNUNIT';
const KPPCPP_ACTIVE = 'KPPCPP_ACTIVE';
const TARGETMIN_ACTIVE = 'TARGETMIN_ACTIVE';
const TARGETMAX_ACTIVE = 'TARGETMAX_ACTIVE';
const TOLARANCE_ACTIVE = 'TOLARANCE_ACTIVE';
const SP_ACTIVE = 'SP_ACTIVE';
const PV_ACTIVE = 'PV_ACTIVE';
const REPORT_ACTIVE = 'REPORT_ACTIVE';
const LL_RC_ACTIVE = 'LL_RC_ACTIVE';
const LL_SP_ACTIVE = 'LL_SP_ACTIVE';
const L_RC_ACTIVE = 'L_RC_ACTIVE';
const L_SP_ACTIVE = 'L_SP_ACTIVE';
const H_RC_ACTIVE = 'H_RC_ACTIVE';
const H_SP_ACTIVE = 'H_SP_ACTIVE';
const HH_RC_ACTIVE = 'HH_RC_ACTIVE';
const HH_SP_ACTIVE = 'HH_SP_ACTIVE';

class Page extends Component {
    constructor(props) {
        super(props);
        //TODO:load this from parent
        this.state = {
            UNITPROCESSID: 139,
            MAIN_CONFIG: '',
        };
    }
    /**
     * Owp에서 사용하는 인풋에 대해 모두 사용할 수 있는 change 이벤트 리시버
     * @param {Event} event 발생한 이벤트 객체
     * @param {Function} callback 콜백 함수. 인풋의 name, value를 인수로 전달함.
     */
    componentDidMount() {
        const _showApprovalDialog = this.showApprovalDialog;
        //this.loadActiveGrid();
    }
    //날짜 디폴드값 설정 함수
    componentWillUnmount() {
        console.log('out');
    }

    loadActiveGrid = () => {
        query({
            url: 'loadOwpMbrUnitProcessMainConfig/' + this.state.UNITPROCESSID,
        }).then((res) => {
            if (res['OWP_MBR_UNIT_PROCESS.MAIN_CONFIG']) {
                let gridData = JSON.parse(res['OWP_MBR_UNIT_PROCESS.MAIN_CONFIG']);
                console.log(gridData);
                setGridData('C0202012', gridData);
                this.canEdit();
                this.getDataFromGrid();
            }
        });
    };

    getDataFromGrid = () => {
        const G = TGEvent.getGridByID('C0202012');
        const _rows = Object.values(G['Rows']).filter((item) => item.Kind == 'Data');
        let arrData = [];
        _rows.some((row) => {
            let rowData = {
                FPNUNIT: row[FPNUNIT],
                KPPCPP_ACTIVE: getBoolValue(row[KPPCPP_ACTIVE]),
                TARGETMIN_ACTIVE: getBoolValue(row[TARGETMIN_ACTIVE]),
                TARGETMAX_ACTIVE: getBoolValue(row[TARGETMAX_ACTIVE]),
                TOLARANCE_ACTIVE: getBoolValue(row[TOLARANCE_ACTIVE]),
                SP_ACTIVE: getBoolValue(row[SP_ACTIVE]),
                PV_ACTIVE: getBoolValue(row[PV_ACTIVE]),
                REPORT_ACTIVE: getBoolValue(row[REPORT_ACTIVE]),
            };
            arrData.push(rowData);
        });
        console.log(JSON.stringify(arrData));
    };

    canEdit = () => {
        const G = TGEvent.getGridByID('C0202012');
        const _rows = Object.values(G['Rows']).filter((item) => item.Kind == 'Data');
        const EDIT_COLUMNS = [
            KPPCPP_ACTIVE,
            TARGETMIN_ACTIVE,
            TARGETMAX_ACTIVE,
            TOLARANCE_ACTIVE,
            SP_ACTIVE,
            PV_ACTIVE,
            REPORT_ACTIVE,
            LL_RC_ACTIVE,
            LL_SP_ACTIVE,
            L_RC_ACTIVE,
            L_SP_ACTIVE,
            H_RC_ACTIVE,
            H_SP_ACTIVE,
            HH_RC_ACTIVE,
            HH_SP_ACTIVE,
        ];
        _rows.some((row) => {
            EDIT_COLUMNS.some((targetColumnName) => {
                setRowAttribute('C0202012', row, targetColumnName, 'BoolIcon', '4', 1);
            });
        });
    };

    render() {
        return (
            <React.Fragment>
                <div style={{ width: '100%' }}>
                    <div className="row">
                        <div className="col-md-12" style={{ padding: '0' }}>
                            <OwpTreeGrid
                                id="C0202012"
                                LayoutUrl="assets/data/C0202012Def.xml"
                                width="100%"
                                // height="21vh"
                            />
                        </div>
                    </div>
                </div>
            </React.Fragment>
        );
    }
}

export default Page;
